import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";


function notewriter(props)
{
  return(
    <Note
    key={props.id}
    title={props.title}
    content={props.content}
    />

  );
}


function App() {
  return (
    <div>
      <Header />
      {notewriter.map(notes)}
      <Footer />
    </div>
  );
}

export default App;
